    private static int consacive(int[] array) {
        List<Integer> arrayList = new ArrayList();
        int max = 0;
        for (int i = 0; i < array.length; i++) {
            if (array[i] != 0) {
                arrayList.add(array[i]);
                if (i == array.length - 1 && max < arrayList.size()) {
                    max = arrayList.size();
                }
            } else {
                if (max < arrayList.size()) {
                    max = arrayList.size();
                    arrayList.clear();
                }
            }
        }
        return max;
    }

